import React, { useState } from 'react';
import './Tab.css';

function Tab({ title}) {
    const [isOpen, setIsOpen] = useState(false);

    return (
        <div className="tab">
            <button onClick={() => setIsOpen(!isOpen)}>
                {title}
            </button>

        </div>
    );
}

export default Tab;
